  `tarjeta_master_card` decimal(9,2) default '0.00',
  `tarjeta_american_express` decimal(9,2) default '0.00',
  PRIMARY KEY  (`id_corte_detalle`)
) ENGINE=MyISAM AUTO_INCREMENT=3 DEFAULT CHARSET=utf8;

